import React from 'react';
import ReactDOM from 'react-dom';
import Heading from './Heading';

ReactDOM.render(
    <>
    <p> A Paragraph</p>
    <ol>
        <li> Hello1 </li>
        <li> Hello2 </li>
        <li> Hello3 </li>
        <li> Hello4 </li>

    </ol>
    </>
    , document.getElementById('root'));







